{
    return static_cast<const Object&>(lhs) == static_cast<const Object&>(rhs);
}

inline bool operator<(const RemoteLogger& lhs, const RemoteLogger& rhs)
{
    return static_cast<const Object&>(lhs) < static_cast<const Object&>(rhs);
}
